syntax = "proto3";
package fanxi;
import "BaseResponse.proto";
import "Player.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "FreeListResponseProto";

message FreeListResponse {
   BaseResponse baseResponse=1;
   int32 zoneId=4;
   int32 tableIndex=5;
   repeated Player players=6;
   
}




